To add some sample expense data to a worksheet we could start with a simple program like the following: # // SPDX-License-Identifier: MIT OR Apache-2.0
# // Copyright 2022, John McNamara, jmcnamara@cpan.org
# # //! A simple program to write some data to an Excel spreadsheet using
# //! rust_xlsxwriter. Part 1 of a tutorial.
# use rust_xlsxwriter::{Workbook, XlsxError}; fn main() -> Result<(), XlsxError> { // Some sample data we want to write to a spreadsheet. let expenses = vec![("Rent", 2000), ("Gas", 200), ("Food", 500), ("Gym", 100)]; // Create a new Excel file. let mut workbook = Workbook::new("tutorial1.xlsx"); // Add a worksheet to the workbook. let worksheet = workbook.add_worksheet(); // Iterate over the data and write it out row by row. let mut row = 0; for expense in expenses.iter() { worksheet.write_string_only(row, 0, expense.0)?; worksheet.write_number_only(row, 1, expense.1)?; row += 1; } // Write a total using a formula. worksheet.write_string_only(row, 0, "Total")?; worksheet.write_formula_only(row, 1, "=SUM(B1:B4)")?; // Close the file. workbook.close()?; Ok(())
} If we run this program we should get a spreadsheet that looks like this: Image of first tutorial 1 This is a simple program but it demonstrates some of the steps that would apply to any rust_xlsxwriter program. The first step is to create a new workbook object using the Workbook constructor. Workbook::new takes one argument which is the filename that we want to create: # // SPDX-License-Identifier: MIT OR Apache-2.0
# // Copyright 2022, John McNamara, jmcnamara@cpan.org
# # //! A simple program to write some data to an Excel spreadsheet using
# //! rust_xlsxwriter. Part 1 of a tutorial.
# # use rust_xlsxwriter::{Workbook, XlsxError};
# # fn main() -> Result<(), XlsxError> {
# // Some sample data we want to write to a spreadsheet.
# let expenses = vec![("Rent", 2000), ("Gas", 200), ("Food", 500), ("Gym", 100)];
# # // Create a new Excel file. let mut workbook = Workbook::new("tutorial1.xlsx");
# # // Add a worksheet to the workbook.
# let worksheet = workbook.add_worksheet();
# # // Iterate over the data and write it out row by row.
# let mut row = 0;
# for expense in expenses.iter() {
# worksheet.write_string_only(row, 0, expense.0)?;
# worksheet.write_number_only(row, 1, expense.1)?;
# row += 1;
# }
# # // Write a total using a formula.
# worksheet.write_string_only(row, 0, "Total")?;
# worksheet.write_formula_only(row, 1, "=SUM(B1:B4)")?;
# # // Close the file.
# workbook.close()?;
# # Ok(())
# } Note , rust_xlsxwriter can only create new files. It cannot read or modify existing files. The workbook object is then used to add a new worksheet via the add_worksheet() method: # // SPDX-License-Identifier: MIT OR Apache-2.0
# // Copyright 2022, John McNamara, jmcnamara@cpan.org
# # //! A simple program to write some data to an Excel spreadsheet using
# //! rust_xlsxwriter. Part 1 of a tutorial.
# # use rust_xlsxwriter::{Workbook, XlsxError};
# # fn main() -> Result<(), XlsxError> {
# // Some sample data we want to write to a spreadsheet.
# let expenses = vec![("Rent", 2000), ("Gas", 200), ("Food", 500), ("Gym", 100)];
# # // Create a new Excel file.
# let mut workbook = Workbook::new("tutorial1.xlsx");
# # // Add a worksheet to the workbook. let worksheet = workbook.add_worksheet();
# # // Iterate over the data and write it out row by row.
# let mut row = 0;
# for expense in expenses.iter() {
# worksheet.write_string_only(row, 0, expense.0)?;
# worksheet.write_number_only(row, 1, expense.1)?;
# row += 1;
# }
# # // Write a total using a formula.
# worksheet.write_string_only(row, 0, "Total")?;
# worksheet.write_formula_only(row, 1, "=SUM(B1:B4)")?;
# # // Close the file.
# workbook.close()?;
# # Ok(())
# } The worksheet will have a standard Excel name, in this case "Sheet1". You can specify the worksheet name using the worksheet.set_name() method. We then iterate over the data and use the worksheet.write_string_only() and worksheet.write_number_only() methods to write each row of our data: # // SPDX-License-Identifier: MIT OR Apache-2.0
# // Copyright 2022, John McNamara, jmcnamara@cpan.org
# # //! A simple program to write some data to an Excel spreadsheet using
# //! rust_xlsxwriter. Part 1 of a tutorial.
# # use rust_xlsxwriter::{Workbook, XlsxError};
# # fn main() -> Result<(), XlsxError> {
# // Some sample data we want to write to a spreadsheet.
# let expenses = vec![("Rent", 2000), ("Gas", 200), ("Food", 500), ("Gym", 100)];
# # // Create a new Excel file.
# let mut workbook = Workbook::new("tutorial1.xlsx");
# # // Add a worksheet to the workbook.
# let worksheet = workbook.add_worksheet();
# # // Iterate over the data and write it out row by row.
# let mut row = 0; for expense in expenses.iter() { worksheet.write_string_only(row, 0, expense.0)?; worksheet.write_number_only(row, 1, expense.1)?; row += 1; }
# # // Write a total using a formula.
# worksheet.write_string_only(row, 0, "Total")?;
# worksheet.write_formula_only(row, 1, "=SUM(B1:B4)")?;
# # // Close the file.
# workbook.close()?;
# # Ok(())
