} The main difference between this and the previous program is that we have added two Format objects that we can use to format cells in the spreadsheet. Format objects represent all of the formatting properties that can be applied to a cell in Excel such as fonts, number formatting, colors and borders. This is explained in more detail in the Format struct documentation. For now we will avoid getting into the details of Format and just use a limited amount of the its functionality to add some simple formatting: # // SPDX-License-Identifier: MIT OR Apache-2.0
